MO.MUiGridCell_calculateStyle = function MUiGridCell_calculateStyle(style){
   var o = this;
   var row = o._row;
   var column = o._column;
   var grid = o._grid;
   var font = o._font;
   if(font){
      font = row.font();
   }
   if(!font){
      font = column.font();
   }
   if(!font){
      font = grid.rowFont();
   }
   style.font = font;
   var alignCd = o._alignCd;
   if(!alignCd){
      alignCd = column.alignCd();
   }
   style.alignCd = alignCd;
}
